import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import football from './something.png'
import SliderImage  from './slider';
import { MDBSticky, MDBStickyContent, MDBContainer } from "mdbreact";
import "./navbar.css";

class Navbars extends React.Component{
    constructor(props){
        super(props);
        this.state={
            isopen:true
        }
    }
    LoginHit=()=>{
        this.setState({isopen:!this.state.isopen})
    }

    render(){
        return(
            <div>
                <MDBContainer>
            <div>
                <MDBSticky>
                <Navbar collapseOnSelect expand="md" dark>
                    <Navbar.Brand href="/">
                    <img src={football} alt="football" 
                    width="60" height="60"
                    className="d-inline-block align-top"
                    />
                    </Navbar.Brand>
                <Navbar.Brand href="/"><div className="heading">Ancast</div> </Navbar.Brand>
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav">
                    <Nav className="mr-auto bar">
                    <Nav.Link href="/login" className="nav-link">Login</Nav.Link>
                    <Nav.Link href="/signup" >SignUp </Nav.Link>
                    </Nav>
                </Navbar.Collapse>
                </Navbar>
                </MDBSticky>
             </div> 
             <MDBStickyContent>
             <SliderImage /> 
             </MDBStickyContent>
             </MDBContainer>
             </div>
        )
      }
    }

export default Navbars;
